function MyVerticallyCenteredModal(props) {
  return (
    <Modal
      {...props}
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header closeButton>
        <Modal.Title id="contained-modal-title-vcenter">
          <div className="modalHeading">
            <img
              src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a0/YouTube_social_red_circle_%282017%29.svg/2048px-YouTube_social_red_circle_%282017%29.svg.png"
              className="youtubeImg"
            />
          </div>
        </Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <p>Name</p>
        <input type="text" className="input" />
        <p>Link</p>
        <input type="text" className="input" />
      </Modal.Body>
      <Modal.Footer>
        <Button onClick={props.onHide}>Upload</Button>
      </Modal.Footer>
    </Modal>
  )
}

